const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Cast = require('../../util/cast');
var beepboxsynthuri = "data:text/javascript;base64,";
var scriptBeepbox = document.createElement("script");
scriptBeepbox.src = beepboxsynthuri;
document.body.appendChild(scriptBeepbox);
scriptBeepbox.onload = function () {
	try {
		window.BeepboxSynthObject = new beepbox.Synth("");
	}catch(e){}
};
var blockIconURI = "data:image/png;base64,";
class beepboxsynth {
    constructor (runtime) {
        this.runtime = runtime;
    }

    getInfo () {
        return {
            id: 'beepboxsynth',
            name: 'Beepbox',
			blockIconURI: blockIconURI,
            blocks: [
                {
                    opcode: 'loadsong',
                    blockType: BlockType.COMMAND,
                    text: 'Load song [Data]',
                    arguments: {
                        Data: {
                            type: ArgumentType.STRING,
                            defaultValue: ""
                        }
                    }
                },
                {
                    opcode: 'playsong',
                    blockType: BlockType.COMMAND,
                    text: 'Play song',
                    arguments: {
						
                    }
                },
                {
                    opcode: 'pausesong',
                    blockType: BlockType.COMMAND,
                    text: 'Pause song',
                    arguments: {
						
                    }
                },
                {
                    opcode: 'isplaying',
                    blockType: BlockType.BOOLEAN,
                    text: 'Is song playing?',
                    arguments: {
						
                    }
                },
                {
                    opcode: 'extractcontents',
                    blockType: BlockType.REPORTER,
                    text: 'Extract data from beepbox url [url]',
                    arguments: {
						url:{
							type: ArgumentType.STRING,
							defaultValue: "https://beepbox.co/#"
						}
                    }
                }
            ],
            menus: {
            }
        };
    }

    loadsong (args) {
		try {
			try{
				window.BeepboxSynthObject.pause();
			}catch(e){}
			window.BeepboxSynthObject = new beepbox.Synth(Cast.toString(args.Data));
		} catch(e) {
			console.log(e);
		}
    }
	playsong  () {
		try {
			window.BeepboxSynthObject.play();
		} catch(e) {
			console.log(e);
		}
	}
	pausesong  () {
		try {
			window.BeepboxSynthObject.pause();
		} catch(e) {
			console.log(e);
		}
	}
	isplaying  () {
		try {
			return window.BeepboxSynthObject.isPlayingSong;
		} catch(e) {
			console.log(e);
			return false;
		}
	}
	extractcontents (args) {
		try {
			return Cast.toString(args.url).split("#").pop();
		} catch(e) {
			console.log(e);
			return false;
		}
	}
}
module.exports = beepboxsynth;